import { useMemo } from "react";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";

export default function Results({ data, search }) {
  console.log(data);
  const getPositions = (data, search) => {
    const index = data.name.last.toLowerCase().indexOf(search);
    const left = data.name.last.slice(0, index);
    const right = data.name.last.slice(index + search.length);
    const center = data.name.last.slice(index, index + search.length);
  };
  getPositions(data, search);

  // const { left, right, center } = useMemo(
  //   () => getPositions(data, search),
  //   [data, search]
  // );

  return (
    <TableRow
      key={data?.login.uuid}
      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
    >
      <TableCell component="th" scope="row">
        {`${data?.name.first} ${data?.name.last}`}
      </TableCell>
      <TableCell>{data?.email}</TableCell>
      <TableCell>{data?.location.country}</TableCell>
      <TableCell>{data?.login.username}</TableCell>
      <TableCell>{data?.registered.age}</TableCell>
    </TableRow>
  );
}
